import Tr_checkBox from "./tr";

function Table_checkbox(props) {
    return (

        <div>
            <table className="table">
                <thead>
                    <tr>
                        <th scope="col">Rubrique</th>
                        <th scope="col">Produit</th>
                        <th scope="col">Qtt</th>
                        <th scope="col">Qualit√©</th>
                    </tr>
                </thead>
                <tbody>
                    {props.listes_article_fixed.map((element,index) => (
                        <Tr_checkBox article_demande={props.article_demande} key={element.idarticle_fixed}  index={index} article_fixed={element} />
                    ))}
                </tbody>
            </table>
        </div>
    );

}
export default Table_checkbox;
